pragma solidity ^0.8.0;

contract lottery{
    address public manager;
    address payable[] public participants;

    constructor(){
        manager=msg.sender;
    }
    receive() external payable{
        require(msg.value==1 ether);
        participants.push(payable(msg.sender));
    }
}

